import React from 'react';

import './Navigation.css';

function Navigation() {
  return (
    <div className="navContainer">
      <a href="#1">新品</a>
      <a href="#2">女士专区</a>
      <a href="#3">男士专区</a>
      <a href="#4">家纺专区</a>
      <a href="#5">配饰专区</a>
      <a href="#6">童装专区</a>
      <a href="#7">戈壁日记</a>
    </div>
  );
}

export default Navigation;
